import React from 'react'

import Carousel from '@brainhubeu/react-carousel'
import '@brainhubeu/react-carousel/lib/style.css'

const MovieTrailers = (props) => {
  const movieTrailerResults = props.movieTrailers.map(r => (
      <div
        key={r.id} >
      </div>
  ))
  return <div className='top-movie-results'>
    <h2 className='top-rated-header'>Trailers</h2>
    <div>
      <Carousel infinite
        slidesPerPage={8}
        slidesPerScroll={3}
        arrows
        animationSpeed={1500}
        stopAutoPlayOnHover
        offset={50}
        itemWidth={225}
        clickToChange
        centered>{movieTrailerResults}</Carousel></div>
  </div>
}

export default MovieTrailers
